import React from "react";

const AddProject = () =>{
    return(
        <React.Fragment>
            <div className="form">
                <body>
                    <form>
                        <h1 className="title">Add Project</h1>
                        

                        <label htmlFor="projectName" className="label"></label>
                    </form>
                </body>
            </div>
        </React.Fragment>
    )
}

export default AddProject;
